import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file with different wait strategy
    await page.goto(fileUrl, { waitUntil: 'domcontentloaded' });

    // Wait for critical elements to be present
    await page.waitForSelector('#searchInput', { state: 'visible' });

    const screenshots = [];

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Focus on search input and type partial query
    const searchInput = await page.$('#searchInput');
    await searchInput.click();
    await searchInput.type('iPhone', { delay: 100 });

    // Wait for autocomplete suggestions to appear
    await page.waitForTimeout(500); // Wait for debounced search
    await page.waitForSelector('.search-suggestions', { state: 'visible', timeout: 5000 });

    // Take screenshot after typing
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_typing.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_typing.png'));

    // Extract autocomplete suggestions
    const suggestions = await page.$$eval('.suggestion-item', items => 
      items.map(item => item.textContent.trim())
    );

    // Verify suggestions contain relevant content
    const hasRelevantSuggestions = suggestions.some(suggestion => 
      suggestion.toLowerCase().includes('iphone')
    );

    if (!hasRelevantSuggestions) {
      throw new Error('No relevant autocomplete suggestions found');
    }

    return {
      success: true,
      action: "Tested search autocomplete functionality - typed 'iPhone' and verified suggestions appear",
      extractedData: {
        suggestions: suggestions,
        suggestionsCount: suggestions.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to test search autocomplete functionality",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
